!function(){"use strict";tinymce.PluginManager.add("img64upload",(function(t){t.ui.registry.addButton("img64upload",{icon:"image",onAction:function(){const n=document.createElement("input");n.type="file",n.accept="image/*",n.onchange=function(n){const e=n.target.files[0],i=new FileReader;i.readAsDataURL(e),i.onload=n=>{const e=`<img src="${n.target.result}" alt="Image" />`;t.insertContent(e)}},n.click()}})}))}();